import React, { useState } from 'react';
import Header from '../components/common/header';
import JobCard from '../components/common/JobCard';
import SearchBar from '../components/common/SearchBar'; // Ensure this component exists

function HomePage() {
  // State to hold job data fetched from the backend
  const [jobs, setJobs] = useState([
    // Placeholder data structure
    {
      id: 1,
      jobTitle: 'Business Development Executive (North America)',
      companyName: 'Gelato Network',
      location: 'New York (NY)',
      jobType: 'Full-Time',
      tags: ['Business Development', 'DeFi', 'Non-Tech', 'Partnerships', 'Web3'],
    },

  ]);

  // Handlers for search functionality
  const handleSearch = (event) => {
    // Placeholder for search functionality
    if (event.key === 'Enter') {
      console.log('Do the search for:', event.target.value);
    }
  };

  return (
    <div className="min-h-screen flex flex-col bg-white">
      <Header /> 

      {/* Search area */}
      <div className="bg-gray-200 p-4">
        <div className="container mx-auto flex flex-col md:flex-row justify-between items-center space-y-4 md:space-y-0">
          <SearchBar placeholder="Role, company, or keywords" onSearch={handleSearch} />
          <SearchBar placeholder="Where?" onSearch={handleSearch} />
        </div>
      </div>

      {/* Job list header */}
      <div className="container mx-auto my-4">
        <h2 className="text-2xl font-semibold">653 blockchain jobs</h2>
      </div>

      {/* Job Listings */}
      <div className="container mx-auto p-4">
        {jobs.map(job => (
          <JobCard key={job.id} {...job} />
        ))}
      </div>

      {/* Subscribe to job alerts */}
      <div className="container mx-auto my-4">
        <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
          Subscribe to job alerts
        </button>
      </div>

      <footer className="bg-gray-200 text-center p-4">
        Â© 2024 Technology Talent Holdings (TTH), Inc.
      </footer>
    </div>
  );
}

export default HomePage;
